    Project",nt"tracking_summary": {ntt"total": 2,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-05-07T00:53:15.090262",nt"name":
    "high-performing-low-temperature-operating-long-lifetime-aerospace-lubricants-project-6bc0c",nt"isopen":
    true,nt"url": null,nt"notes": "Physical Sciences Inc. (PSI) proposes to
    synthesize, characterize, and test new ionic liquids and formulations as lubricants
    for aerospace applications.  The compounds will have low vapor pressures/outgassing
    and appropriate thermal stability.  Upon addition of the innovative ionic liquids
    to the base lubricants, a 20&#37; decrease in viscosity, friction coefficient, and
    wear will result.  Minimal corrosive effects of the formulations at will be observed.
     The formulations will be shown more effective as liquid lubricants for use at
    low temperatures (-70oC) with long-term operational stability in aerospace systems.
     Several new ionic liquids will be scaled and a novel formulation will be evaluated
    in a NASA test bed.  The technology will be at a TRL range from 3-4 upon completion
    of Phase II.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
